import React from "react"
import "../App.css";
import WomanImage from "../images/illustration-woman-online-desktop.svg"

class Illustration extends React.Component {
    render() {
        return (
            <img class="woman-img" src="illustration-woman-online-desktop.svg" />
        );
    }
}

export default Illustration;
